import { Component } from "react";
import logo from "./logo.svg";
import Navigation from "./components/navigation.jsx";
import ImageLinkForm from "./components/imageLinkForm.jsx";
import Clarifai from "clarifai";
import Rank from "./components/Rank.jsx";
import Particles from "react-particles-js";
import "tachyons";
console.log(document.clientX);

const app = new Clarifai.App({ apiKey: "e0c918f4d9e144a0b85687eedd9a4375" });

class App extends Component {
  onInputChange = (e) => {
    console.log(e.target.value);
  };
  onSubmit = () => {
    console.log("submit !");
    app.models
      .predict(
        Clarifai.GENERAL_MODEL,
        "https://samples.clarifai.com/metro-north.jpg",
        {
          selectConcepts: [{ id: "ai_6kTjGfF6" }],
        }
      )
      .then(
        function (response) {
          console.log(response);
        },
        function (err) {
          console.warn(err);
        }
      );
  };
  render() {
    return (
      <div className="App">
        <Particles
          className="background"
          params={{
            particles: {
              number: {
                value: (window.innerHeight * window.innerWidth) / 10000,
              },
              size: {
                value: 3,
              },
            },
            interactivity: {
              events: {
                onclick: {
                  enable: true,
                  mode: "repulse",
                },
              },
            },
          }}
        />
        <Navigation />
        <Rank />
        <ImageLinkForm
          onInputChange={this.onInputChange}
          onSubmit={this.onSubmit}
        />
      </div>
    );
  }
}

export default App;
